import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './authentication/login/login.component';
import { UserRegisterComponent } from './authentication/user-register/user-register.component';
import { DriverRegisterComponent } from './authentication/driver-register/driver-register.component';
import { AuthenticationModule } from './authentication/authentication.module';

const accountModule = () => import('./authentication/authentication.module').then(x => x.AuthenticationModule);
const routes: Routes = [
    { path: 'account', loadChildren: authenticationModule}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
